  return (
    <div className="flex border-b ">
      <div className="flex items-center">
        <img
          className="rounded-full h-8 w-8 flex mr-3"
          src={`/favicon.ico`}
        />
        <p className="font-bold">{username}</p>
      </div>
    </div>
  );
}
